I have a list of words in an array. I want to sort them in alphabetical order. But I want to use case-sensative sorting. For example, if I have an array like this:
var arr = ["apple", "Apple", "banana", "Banana"];
I want to sort it like this:
["Apple", "apple", "Banana", "banana"]
How can I do this in JavaScript?
